create table experiences
(
    Level          smallint auto_increment
        primary key,
    CharacterExp   bigint            null,
    GuildExp       bigint            null,
    MountExp       bigint            null,
    PetExp         bigint            null,
    AlignmentHonor smallint unsigned null,
    JobExp         int               null
)
    engine = MyISAM
    charset = utf8;

